def transform(sequence):
    num_count = {"0": 0, "1": 0, "2": 0, "3": 0}

    for num in sequence:
        num_count[num] += 1

    transformed_sequence = "0" * num_count["0"] + "1" * num_count["1"] + "2" * num_count["2"] + "3" * num_count["3"]

    return transformed_sequence
